DROP DATABASE IF EXISTS fitnessDB;
CREATE DATABASE fitnessDB;
USE fitnessDB;


DROP TABLE IF EXISTS `Exercise`;

CREATE TABLE `Exercise` (
  `bodyType` ENUM ('bodybuilder', 'muscular') NOT NULL,
  `BodyPart` char(30) NOT NULL,
  `exercise` char(30) NOT NULL,
  `reps` int(11) NOT NULL,
  `_sets` int(11) NOT NULL,
  `equipment` char(30),
  `gender_preference` ENUM ('M', 'F', 'M/F')NOT NULL, 
  `pic` longblob,
  PRIMARY KEY (`exercise`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


