DROP TABLE IF EXISTS `Users`;
CREATE TABLE `Users` (
  `IDno` int NOT NULL auto_increment,
  `username` varbinary(100) NOT NULL,
  `password` varbinary(255) NOT NULL, 
   PRIMARY KEY (`username`),
   unique Key (`IDno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


