DROP TABLE IF EXISTS `Days`;
CREATE TABLE `Days` (
  `IDno` int,
  `Monday` ENUM('yes', 'no', 'none'),
  `Tuesday` ENUM('yes', 'no', 'none'),
  `Wednesday` ENUM('yes', 'no', 'none'),
  `Thursday` ENUM('yes', 'no','none'),
  `Friday` ENUM('yes', 'no', 'none'),
  `Saturday` ENUM('yes', 'no', 'none'),
  `Sunday` ENUM('yes', 'no', 'none'),
   PRIMARY KEY (`IDno`) 
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

